 ('6', '7', '3', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Locations\",\"slug\":\"locations\",\"postDate\":1458012046,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":[]}', '2016-03-15 03:20:46', '2016-03-15 03:20:46', 'd069d529-117a-4593-853c-16e0e33ecdd5'),
 ('7', '2', '1', '1', 'en_us', '3', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1457804906,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"5\":{\"new1\":{\"type\":\"homeHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Kick. Punch. Learn.\",\"body\":\"<p>Freddie Poole\\u2019s Martial Arts\\u00ae is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"10\"]}}}}}', '2016-03-16 02:47:49', '2016-03-16 02:47:49', '549b88e2-25a6-4171-ab05-3530b6435258'),
