 ('9', '17', '3', '1', 'en_us', '1', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Juniors\",\"slug\":\"juniors\",\"postDate\":1458100080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"6\",\"fields\":{\"5\":\"\",\"22\":\"Juniors (7 -12 YO)\",\"4\":\"\",\"3\":\"\"}}', '2016-03-16 03:48:00', '2016-03-16 03:48:00', '5b3f1250-c67b-4741-b60f-4769af7f98ec'),
 ('10', '2', '1', '1', 'en_us', '4', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1457804906,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"5\":{\"15\":{\"type\":\"homeHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Kick. Punch. Learn.\",\"body\":\"<p>Freddie Poole\\u2019s Martial Arts\\u00ae is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"10\"]}},\"new1\":{\"type\":\"homePrograms\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Approach\",\"body\":\"<p>This unique approach creates a balanced and well-rounded martial artist. The key to our success is that each discipline is introduced in stages to the student, rather than front-loading a program. This methodical approach ensures students are learning and mastering techniques at the highest level, as opposed to just going through motions.&nbsp;<\\/p>\",\"programs\":[\"16\",\"17\"]}}}}}', '2016-03-16 04:17:39', '2016-03-16 04:17:39', '51438fc2-415c-48fc-98d5-3740d3ce84cf'),
