 ('12', '2', '1', '1', 'en_us', '6', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1457804906,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"5\":{\"15\":{\"type\":\"homeHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Kick. Punch. Learn.\",\"body\":\"<p>Freddie Poole\\u2019s Martial Arts\\u00ae is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"14\"]}},\"18\":{\"type\":\"homePrograms\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Approach\",\"body\":\"<p>This unique approach creates a balanced and well-rounded martial artist. The key to our success is that each discipline is introduced in stages to the student, rather than front-loading a program. This methodical approach ensures students are learning and mastering techniques at the highest level, as opposed to just going through motions.&nbsp;<\\/p>\",\"programs\":[\"16\",\"17\"],\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"14\"]}}}}}', '2016-03-16 04:29:28', '2016-03-16 04:29:28', '43dd440a-86b3-4e5f-975f-41aab057aac0'),
 ('13', '2', '1', '1', 'en_us', '7', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1457804906,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"5\":{\"15\":{\"type\":\"homeHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Kick. Punch. Learn.\",\"body\":\"<p>Freddie Poole\\u2019s Martial Arts\\u00ae is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"8\"]}},\"18\":{\"type\":\"homePrograms\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Approach\",\"body\":\"<p>This unique approach creates a balanced and well-rounded martial artist. The key to our success is that each discipline is introduced in stages to the student, rather than front-loading a program. This methodical approach ensures students are learning and mastering techniques at the highest level, as opposed to just going through motions.&nbsp;<\\/p>\",\"programs\":[\"16\",\"17\"],\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"14\"]}}}}}', '2016-03-16 04:30:39', '2016-03-16 04:30:39', '091769cb-c3ba-401f-af10-60a5ef74fcc9'),
 ('14', '16', '3', '1', 'en_us', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Dragons\",\"slug\":\"dragons\",\"postDate\":1458099960,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"6\",\"fields\":{\"5\":{\"new1\":{\"type\":\"secondaryHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Brazilian Jiu Jitsu\",\"body\":\"<p>Brazilian Jiu-jitsu classes in Dallas (BJJ) is primarily a ground fighting art, a grappling style of Martial Arts that has roots and evolved from Japanese Judo and Classical jujutsu. Brazilian Jiu-jitsu specializes in ground techniques such as positional control and the use of leverage for reversals and submissions holds (joint lock and chokes) to overcome the size and strength of opponents. BJJ provides a clear path and strategy for victory in a self-defense scenario or competition. As a sport it is a safe and entertaining art that can be practiced for a lifetime of fitness and well-being.<\\/p>\",\"contactButton\":[\"on\"],\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"8\"]}},\"new2\":{\"type\":\"oneColumn\",\"enabled\":\"1\",\"fields\":{\"heading\":\"History\",\"body\":\"<p>Most people involved in Martial Arts are familiar with the basic history of BJJ. How a Japanese Jiu-jitsu expert, Maeda, came to Brazil as part of a diplomatic mission to found and establish a Japanese colony. He befriended Gastao Gracie, a man of Scottish decent who had influence in local political circles.<\\/p>\\r\\n\\r\\n<p>Maeda offered to teach Gracie\\u2019s sons Jiu-jitsu.<br>The Gracie boys became very proficient in jiu-jitsu. Being a large family they never lacked training partners and new ideas for practicing and training daily within the family and nephews the Machados. This went on for generations. Later opening their own schools and developing their own additions and modifications to the techniques they had being taught, as a test of their skill, the Gracies fought many matches against other styles with great success.<\\/p>\\r\\n\\r\\n<p>In this manner they came to understand which techniques worked and which did not. They based their developing martial arts on their combat experiences over generations. With great success in MMA competitions, Brazilian jiu-jitsu has establish itself as an extremely effective martial arts and one of the most sought out.<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"12\"]}},\"new3\":{\"type\":\"oneColumn\",\"enabled\":\"1\",\"fields\":{\"heading\":\"The BJJ strategy and the Japanese legacy\",\"body\":\"<p>eda taught the Gracie\\u2019s the art of \\u201cRandori\\u201d or live training (rolling) where safe but effective techniques can be applied with full resistance to opponents, as long as they agree to \\u201ctap-out\\u201d or submit (surrender) when a technique is successfully applied. This way, two opponents can face each other and fight close to full power which makes training much more realistic to a real fight, therefore more effective.<\\/p>\\r\\n\\r\\n<p>The genius of the Gracie\\u2019s lay in the strategy they implemented to win fights, which can be seen in sport point systems, they implemented in competition. The Gracie\\u2019s realized that fighting a bigger stronger opponent and trading blows was not a good idea, so they developed a strategy where they would take a standing opponent or fighter out of their comfort zone (stand up skill) put them on the ground and expose them to their great ground skills, positional control, leverage and submissions.<br>The Gracie\\u2019s realized that certain positions were better to attack and defend so they strategized ways from any position on the ground to a position where they can reverse, control and submit their opponent.<\\/p>\",\"backgroundColor\":\"#f5f5f5\",\"backgroundImage\":\"\"}}},\"22\":\"Dragons (4 \\u2013 6 YO)\",\"4\":\"\",\"3\":\"\"}}', '2016-03-24 02:37:17', '2016-03-24 02:37:17', '08de09b9-cafc-49af-aa19-b9c1a78c89a2'),
 ('15', '2', '1', '1', 'en_us', '8', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1457804906,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"5\":{\"15\":{\"type\":\"homeHero\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Kick. Punch. Learn.\",\"body\":\"<p>Freddie Poole\\u2019s Martial Arts\\u00ae is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;<\\/p>\",\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"8\"],\"contactButton\":\"1\"}},\"18\":{\"type\":\"homePrograms\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Approach\",\"body\":\"<p>This unique approach creates a balanced and well-rounded martial artist. The key to our success is that each discipline is introduced in stages to the student, rather than front-loading a program. This methodical approach ensures students are learning and mastering techniques at the highest level, as opposed to just going through motions.&nbsp;<\\/p>\",\"programs\":[\"16\",\"17\"],\"backgroundColor\":\"#000000\",\"backgroundImage\":[\"14\"]}}}}}', '2016-03-24 02:42:11', '2016-03-24 02:42:11', '1248b846-7957-4ffd-8846-d95fee7f029e'),
